import React from "react";
import './Menubar.css';
const Menubar = ()=>{

    return(
        <div id="menubar" className="menubar">
                <div className="profilephoto">
                    <div className="head"></div>
                    <div className="body"></div>
                    <input type="file"></input>
                </div>
        </div>
    );
}
export default Menubar;
